  return (
    <table>
      <thead>
        <tr>

          <td>Nome</td>
          <td>Espécie</td>
          <td>Gênero</td>
          <td>Status</td>
          <td>Quantidade de Episódios</td>
        </tr>
      </thead>
      <tbody>
        {
          results.map((qq) => (
            <tr key={ qq.id }>
              <td>{ qq.name }</td>
              <td>{ qq.species }</td>
              <td>{ qq.gender }</td>
              <td>{ qq.status }</td>
              <td>{ qq.episode.length }</td>
            </tr>
          ))
        }
      </tbody>
    </table>
  );
}
